css:
.console {
  display: flex;
  flex-direction: column;
  width: 100%;
}
.ui-toolbar {
  background-color: #1D252C;
}
atom-dock .ui-toolbar,
atom-panel .ui-toolbar {
  background-color: #181d23;
}
.console-body {
  display: flex;
  flex: 1;
  flex-direction: column;
  font-size: 10.8px;
  background-color: #192434;
  line-height: 1.5;
  min-height: 0;
}
.console-lazy-nested-value div,
.console-lazy-nested-value span {
  font-family: Menlo, Monaco, Consolas, "Courier New", monospace;
  white-space: pre-wrap;
  word-break: normal;
  word-wrap: break-word;
}
.console-lazy-nested-value {
  display: flex;
}
.console-lazy-nested-value .list-item::before div {
  display: flex;
}
.console-lazy-nested-value .list-tree li:not(.list-nested-item) {
  line-height: 1.6em;
}
.console-lazy-nested-value div.list-item > div {
  display: inline-block;
}
.console-table-wrapper {
  display: flex;
  flex: 1;
  overflow-x: hidden;
  overflow-y: hidden;
  background-color: #192434;
  -webkit-user-select: text;
}
.console-record {
  display: flex;
  padding: 0.1em 0.5em;
  padding-left: 1em;
  background-color: #192434;
  border-radius: 0;
  border-top: 0.1em solid #111822;
  color: #ffffff;
  cursor: text;
  border-left: 8px solid transparent;
}
.console-record::before {
  width: 0.5em;
  position: absolute;
  left: 0;
  bottom: 0.1em;
  top: 0;
  content: '';
}
.console-record,
.console-record.console-record.console-record .list-item {
  color: #ffffff;
}
.console-record pre,
.console-record code {
  font-size: inherit;
  background-color: transparent;
  word-break: normal;
  white-space: pre-wrap;
}
.console-record pre,
.console-record code,
.console-record pre a {
  color: #ffffff;
}
.console-record .icon {
  color: rgba(255, 255, 255, 0.3);
  font-size: inherit;
  text-align: center;
}
.console-record .icon::before {
  margin-right: 0.5em;
}
.console-record:first-child {
  border-top: none;
}
.console-record:last-child {
  border-bottom: 0.1em solid #111822;
}
.console-record.level-info .icon {
  color: #539afc;
}
.console-record.level-warning::before {
  background-color: #b7761e;
}
.console-record.level-warning .console-record-duplicate-number {
  background-color: #ebbf83;
}
.console-record.level-warning pre,
.console-record.level-warning pre a,
.console-record.level-warning .console-lazy-nested-value div,
.console-record.level-warning .console-lazy-nested-value span {
  color: #ebbf83;
}
.console-record.level-warning .icon {
  color: #b7761e;
}
.console-record.level-success::before {
  background-color: #36904b;
}
.console-record.level-success .console-record-duplicate-number {
  background-color: #8bd49c;
}
.console-record.level-success pre,
.console-record.level-success pre a,
.console-record.level-success .console-lazy-nested-value div,
.console-record.level-success .console-lazy-nested-value span {
  color: #8bd49c;
}
.console-record.level-success .icon {
  color: #36904b;
}
.console-record.level-error::before {
  background-color: #a22537;
}
.console-record.level-error .console-record-duplicate-number {
  background-color: #e27e8d;
}
.console-record.level-error pre,
.console-record.level-error pre a,
.console-record.level-error .console-lazy-nested-value div,
.console-record.level-error .console-lazy-nested-value span {
  color: #e27e8d;
}
.console-record.level-error .icon {
  color: #a22537;
}
.console-record.level-red {
  background-color: #dd697b;
}
.console-record.level-red pre,
.console-record.level-red pre a,
.console-record.level-red .console-lazy-nested-value div,
.console-record.level-red .console-lazy-nested-value span {
  color: #791b29;
}
.console-record.level-red .console-record-duplicate-number {
  background-color: #791b29;
  color: #dd697b;
}
.console-record.level-orange {
  background-color: #e6c299;
}
.console-record.level-orange pre,
.console-record.level-orange pre a,
.console-record.level-orange .console-lazy-nested-value div,
.console-record.level-orange .console-lazy-nested-value span {
  color: #291b0a;
}
.console-record.level-orange .console-record-duplicate-number {
  background-color: #291b0a;
  color: #e6c299;
}
.console-record.level-yellow {
  background-color: #f9f5cd;
}
.console-record.level-yellow pre,
.console-record.level-yellow pre a,
.console-record.level-yellow .console-lazy-nested-value div,
.console-record.level-yellow .console-lazy-nested-value span {
  color: #3f3a08;
}
.console-record.level-yellow .console-record-duplicate-number {
  background-color: #3f3a08;
  color: #f9f5cd;
}
.console-record.level-green {
  background-color: #70e6be;
}
.console-record.level-green pre,
.console-record.level-green pre a,
.console-record.level-green .console-lazy-nested-value div,
.console-record.level-green .console-lazy-nested-value span {
  color: #020906;
}
.console-record.level-green .console-record-duplicate-number {
  background-color: #020906;
  color: #70e6be;
}
.console-record.level-blue {
  background-color: #80c3ff;
}
.console-record.level-blue pre,
.console-record.level-blue pre a,
.console-record.level-blue .console-lazy-nested-value div,
.console-record.level-blue .console-lazy-nested-value span {
  color: #001b33;
}
.console-record.level-blue .console-record-duplicate-number {
  background-color: #001b33;
  color: #80c3ff;
}
.console-record.level-purple {
  background-color: #ec9cd9;
}
.console-record.level-purple pre,
.console-record.level-purple pre a,
.console-record.level-purple .console-lazy-nested-value div,
.console-record.level-purple .console-lazy-nested-value span {
  color: #330a29;
}
.console-record.level-purple .console-record-duplicate-number {
  background-color: #330a29;
  color: #ec9cd9;
}
.console-record.level-violet {
  background-color: #f4c7ea;
}
.console-record.level-violet pre,
.console-record.level-violet pre a,
.console-record.level-violet .console-lazy-nested-value div,
.console-record.level-violet .ui-lazy-nested-value span {
  color: #5e124c;
}
.console-record.level-violet .console-record-duplicate-number {
  background-color: #5e124c;
  color: #f4c7ea;
}
.console-record.level-rainbow {
  background: #fff;
  background-image: linear-gradient(to right, rgba(255, 0, 0, 0.4) 0%, rgba(255, 165, 0, 0.4) 20%, rgba(255, 255, 0, 0.4) 40%, rgba(173, 255, 47, 0.4) 60%, rgba(0, 191, 255, 0.4) 80%, rgba(138, 43, 226, 0.4) 100%);
}
.console-record.level-rainbow pre,
.console-record.level-rainbow pre a,
.console-record.level-rainbow .console-lazy-nested-value div,
.console-record.level-rainbow .ui-lazy-nested-value span,
.console-record.level-rainbow .list-group li:not(.list-nested-item),
.console-record.level-rainbow .list-tree li:not(.list-nested-item),
.console-record.level-rainbow .list-group li.list-nested-item > .list-item,
.console-record.level-rainbow .list-tree li.list-nested-item > .list-item {
  color: #000;
}
.console-record.level-rainbow .console-record-duplicate-number {
  background-color: #000;
  color: #fff;
}
.console-record pre {
  display: inline;
  padding: 0;
  background-color: transparent;
}
.console-record.request {
  display: flex;
  background-color: #192434;
}
.console-record:hover {
  background-color: #1c293b;
}
.console-record-content-wrapper {
  display: flex;
  width: 100%;
  padding-top: 1px;
  padding-bottom: 1px;
}
.console-record-content-wrapper .ui-lazy-nested-value-treelist li.list-nested-item > .list-item,
.console-record-content-wrapper .ui-lazy-nested-value-treelist .list-item {
  line-height: inherit;
}
.console-record-duplicate-number {
  background: #ffffff;
  border-radius: 1em;
  color: #192434;
  display: flex;
  flex-direction: column;
  font-weight: bold;
  height: 1.4em;
  justify-content: center;
  margin-top: auto;
  margin-bottom: auto;
  margin-right: 8px;
  min-width: 1.4em;
  padding: 0 0.4em;
  text-align: center;
}
.console-record-content {
  flex: 1;
}
.console-record-source-label,
.console-record-timestamp {
  align-self: flex-start;
  margin: 2px 0 0 4px;
  white-space: nowrap;
  font-size: 0.8em;
}
span.console-record-source-label,
span.console-record-timestamp {
  padding-top: 0;
  padding-bottom: 0;
}
.console-record-timestamp {
  background-color: #192434;
  padding: 1px 2px;
}
.console-input-wrapper {
  display: flex;
  background-color: #192434;
  padding: 0.1em 0;
  flex-grow: 1;
}
.console-input-wrapper atom-text-editor {
  font-size: 10.8px;
}
.console-prompt {
  display: flex;
  padding: 5px 0.5em;
  border-top: 1px solid #181d23;
  background-color: #192434;
  color: #ffffff;
  min-height: 30px;
  margin-top: auto;
}
.console-multiline-tip {
  padding: 0px 0px 5px 100px;
  font-size: 0.8em;
}
.console-multiline-tip-dim {
  opacity: 0.5;
}
.console-multiline-tip-not-dim {
  opacity: 0.8;
}
.console-prompt-wrapper {
  display: flex;
  align-items: center;
  white-space: nowrap;
}
.console-prompt-label {
  text-transform: uppercase;
  font-weight: bold;
  font-size: 0.8em;
  padding-right: 1em;
}
.console-scroll-pane-wrapper {
  position: relative;
  display: flex;
  flex: 1 0;
  flex-direction: column;
  overflow: hidden;
}
.console-new-messages-notification {
  position: absolute;
  bottom: 0;
  left: 50%;
  text-align: center;
  padding-left: 16px;
  padding-right: 16px;
  cursor: pointer;
  transition: all 0.3s cubic-bezier(0.175, 0.885, 0.32, 1.275);
}
.console-new-messages-notification.visible {
  margin-bottom: 8px;
  transform: translateX(-50%) translateY(0);
}
.console-new-messages-notification:not(.visible) {
  margin-bottom: 0;
  transform: translateX(-50%) translateY(100%);
}
.console-new-messages-notification-icon {
  display: inline-block;
  vertical-align: middle;
  text-align: left;
}
.console-new-messages-notification-icon::before {
  width: auto !important;
}
.console-filtered-reminder {
  display: flex;
  font-style: italic;
}
.console-filtered-reminder a {
  text-decoration: underline;
}
.console-process-control-button {
  transform: translate3d(0, 0, 0);
}
.console-process-starting-spinner {
  margin: 0 0.5em 0 0.5em;
}
.console-table-row-wrapper {
  overflow-x: auto;
  overflow-y: hidden;
  padding-bottom: 3px;
}
